import { IoDocumentTextOutline } from "react-icons/io5";

function OpeningFileIcon () {
    return (
        <Draggable
            defaultPosition={{x: 0, y: 0}}
            className="absolute"
        >
            <div className="flex flex-column text-center bg-blue-50">
                <div>

                </div>
                <div>
                    Opening.txt
                </div>
            </div>
        </Draggable>
    )
}

export default OpeningFileIcon;
